import React from 'react';
import styled from 'styled-components';

const ServicesSection = styled.section`
  padding: 100px 0;
  background-color: ${props => props.theme.colors.background};
`;

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 2rem;
`;

const Title = styled.h2`
  font-family: ${props => props.theme.fonts.primary};
  font-size: 2.5rem;
  text-align: center;
  margin-bottom: 3rem;
  color: ${props => props.theme.colors.text};
`;

const ServicesGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 2rem;
`;

const ServiceCard = styled.div`
  background-color: ${props => props.theme.colors.accent};
  padding: 2rem;
  border-radius: 8px;
  transition: transform 0.3s ease;

  &:hover {
    transform: translateY(-5px);
  }
`;

const ServiceIcon = styled.div`
  font-size: 2.5rem;
  color: ${props => props.theme.colors.primary};
  margin-bottom: 1rem;
  text-align: center;
`;

const ServiceTitle = styled.h3`
  font-family: ${props => props.theme.fonts.primary};
  font-size: 1.5rem;
  margin-bottom: 1rem;
  text-align: center;
  color: ${props => props.theme.colors.text};
`;

const ServiceDescription = styled.p`
  font-size: 1rem;
  line-height: 1.6;
  text-align: center;
  color: ${props => props.theme.colors.text};
`;

const FAQSection = styled.div`
  margin-top: 4rem;
`;

const FAQTitle = styled.h3`
  font-family: ${props => props.theme.fonts.primary};
  font-size: 2rem;
  text-align: center;
  margin-bottom: 2rem;
  color: ${props => props.theme.colors.text};
`;

const FAQItem = styled.div`
  margin-bottom: 1.5rem;
`;

const Question = styled.h4`
  font-family: ${props => props.theme.fonts.secondary};
  font-size: 1.2rem;
  color: ${props => props.theme.colors.primary};
  margin-bottom: 0.5rem;
`;

const Answer = styled.p`
  font-size: 1rem;
  line-height: 1.6;
  color: ${props => props.theme.colors.text};
`;

const Services = () => {
  const services = [
    {
      icon: "🏠",
      title: "Conseil en Décoration",
      description: "Recommandations personnalisées pour transformer votre espace avec des solutions créatives et adaptées à votre style de vie."
    },
    {
      icon: "🔨",
      title: "Rénovation Intérieure",
      description: "Gestion complète de vos projets de rénovation, de la conception à la réalisation, en collaboration avec des artisans qualifiés."
    },
    {
      icon: "📐",
      title: "Aménagement d'Espaces",
      description: "Optimisation de vos espaces pour maximiser leur potentiel tout en respectant vos besoins fonctionnels et esthétiques."
    }
  ];

  const faqs = [
    {
      question: "Comment se déroule notre première consultation ?",
      answer: "La première consultation commence par une discussion approfondie sur vos besoins, votre style et votre budget. Nous visitons ensuite l'espace concerné pour évaluer son potentiel et les possibilités d'aménagement."
    },
    {
      question: "Quelle est la durée moyenne d'un projet ?",
      answer: "La durée varie selon l'ampleur du projet. Une simple consultation déco peut prendre quelques semaines, tandis qu'une rénovation complète peut s'étendre sur plusieurs mois."
    },
    {
      question: "Travaillez-vous avec un budget limité ?",
      answer: "Absolument ! Nous adaptons nos solutions à tous les budgets. L'important est d'être transparent dès le début pour pouvoir proposer des solutions créatives adaptées à vos moyens."
    }
  ];

  return (
    <ServicesSection id="services">
      <Container>
        <Title>Nos Services</Title>
        <ServicesGrid>
          {services.map((service, index) => (
            <ServiceCard key={index}>
              <ServiceIcon>{service.icon}</ServiceIcon>
              <ServiceTitle>{service.title}</ServiceTitle>
              <ServiceDescription>{service.description}</ServiceDescription>
            </ServiceCard>
          ))}
        </ServicesGrid>

        <FAQSection>
          <FAQTitle>Questions Fréquentes</FAQTitle>
          {faqs.map((faq, index) => (
            <FAQItem key={index}>
              <Question>{faq.question}</Question>
              <Answer>{faq.answer}</Answer>
            </FAQItem>
          ))}
        </FAQSection>
      </Container>
    </ServicesSection>
  );
};

export default Services;
